import './App.scss';
import { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button, Container, Nav, Navbar, NavDropdown, Alert } from 'react-bootstrap';
import OffcanvasReact from './Offcanvas/OffcanvasReact';

function App() {

  const [show, setShow] = useState(true);
  return (
    <div className="App">
      <div className='ButtonBx'>
        <Button variant="outline-primary">Primary</Button>{' '}
      </div>
      <div className='offcanvasBx'>
        {['start'].map((placement, idx) => (
          <OffcanvasReact key={idx} placement={placement} name={placement} />
        ))}
      </div>
      <br></br>
      <div className='alertBx'>
        <Alert show={show} variant="success">
          <Alert.Heading>How's it going?!</Alert.Heading>
          <p>
            Duis mollis, est non commodo luctus, nisi erat porttitor ligula, eget
            lacinia odio sem nec elit. Cras mattis consectetur purus sit amet
            fermentum.
          </p>
          <hr />
          <div className="d-flex justify-content-end">
            <Button variant="red" onClick={() => setShow(false)} variant="outline-success">
              Close me y'all!
            </Button>
          </div>
        </Alert>

        {!show && <Button onClick={() => setShow(true)}>Show Alert</Button>}
      </div>

    </div>
  );
}

export default App;
